import './App.css';
import {BrowserRouter, Routes, Route, } from 'react-router-dom'
function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <header>react</header>

        <main>
          <Routes>
            <Route path="/" element={<h1>ExercisesList</h1>} />
            <Route path="/edit/:id" element={<h1>EditExer</h1>} />
            <Route path="/contact" element={<h1>Contact</h1>} />
          </Routes>
        </main>
        <footer>footer</footer>
      </div>
    </BrowserRouter>
  );
}

export default App;
